{

    int ret = ff_libwebp_encode_init_common(avctx);

    if (!ret) {

        LibWebPAnimContext *s = avctx->priv_data;

        WebPAnimEncoderOptions enc_options;

        WebPAnimEncoderOptionsInit(&enc_options);

